import React ,{Component} from 'react';

import order_logo from '../../images/order_logo.jpg';
import './Admin.css';

class Admin extends Component{
    render(){
        return(
            <div>
            <div className="container">
            <div className="one">
            <img src={order_logo}/>
            Customer
            </div>
            <div className="two">
            Order
            </div>
            <div className="three">
            Product
            </div>
            <div className="four">
            Category
            </div>
           </div>
            </div>
        );
    };
};

export default Admin;
